import { React } from "react";
import { useUser } from "../components/auth/useUser.js";
import { useToken } from "../components/auth/useToken.js";
import axios from "axios";

async function Dashboard() {
	const user = useUser();
	const { _id, username, email, admin } = user;

	return (
		<div>
			<div>
				<h1>{username}</h1>
				<h2>{email}</h2>
				<h3>{admin}</h3>
			</div>
		</div>
	);
}

export default Dashboard;
